public class Solution {
    public int MinAbsoluteDifference(IList<int> nums, int x) {
        if (x == 0) return 0;

        int minDiff = int.MaxValue;
        for (int i = 0; i < nums.Count; i++) {
            for (int j = i + x; j < nums.Count; j++) {
                minDiff = Math.Min(minDiff, Math.Abs(nums[i] - nums[j]));
            }
        }

        return minDiff;
    }
}
